            return content
        return False

    def send(self, info):
        try:
            addr = info.get('addr')
            content = info.get('content')
            self.send_struct = {"addr": addr, "content": content}
        except:
            return "Error in sending information"

    def show(self, type):
        if type == 'send':
            return self.send_struct
        elif type == 'receive':
            return self.receive_struct
        return False
